import React, { Component } from 'react'
import './Header.scss'


interface HeaderState {
  navigationId: string;
}

export default class Header extends Component<{},HeaderState> {
  state = {
      navigationId: "",
  }

  render() {
    return (
      <div className="header navbar navbar-light bg-light">
        <div className="logo">
          <img src="" alt="logo" />
        </div>
        <div className="menu"></div>
      </div>
    )
  }
}
